void Voice_noteOff(Voice__ctx_type_0 &_ctx, int note, int channel){
   note = int_clip(note,0,127);
   int v;
   v = _ctx.notes[note];
   if((v > 0) && (v <= 4)){
      if(Notes_noteOff(_ctx.voicesactive,((-1) + v),0)){
         Voice__sendNoteOff(_ctx,((-1) + v),note,channel);
         _ctx.notes[note] = 0;
         _ctx.voices[((-1) + v)] = 0;
         Notes_noteOn(_ctx.voicesinactive,((-1) + v),127,0);
      }
   }
}

void Voice_noteOn(Voice__ctx_type_0 &_ctx, int note, int velocity, int channel){
   note = int_clip(note,0,127);
   if(_ctx.notes[note] <= 0){
      int v;
      v = Notes_firstNote(_ctx.voicesinactive);
      if(v <= 0){
         int active_v;
         active_v = Notes_firstNote(_ctx.voicesactive);
         if(active_v > 0){
            Voice_noteOff(_ctx,_ctx.voices[((-1) + active_v)],0);
         }
      }
      v = Notes_firstNote(_ctx.voicesinactive);
      if(v > 0){
         if(Notes_noteOff(_ctx.voicesinactive,((-1) + v),0) && Notes_noteOn(_ctx.voicesactive,((-1) + v),127,0)){
            Voice__sendNoteOn(_ctx,((-1) + v),note,velocity,channel);
            _ctx.notes[note] = v;
            _ctx.voices[((-1) + v)] = note;
         }
      }
   }
}

void Voice_setNbVoices(Voice__ctx_type_0 &_ctx, int nbvoices){
   nbvoices = int_clip(nbvoices,0,4);
   int i;
   i = Notes_nbNotes(_ctx.voicesactive);
   while((i > nbvoices) && (i > 0)){
      Voice_noteOff(_ctx,_ctx.voices[((-1) + i)],0);
      Notes_noteOff(_ctx.voicesinactive,((-1) + i),0);
      i = ((-1) + i);
   }
   i = Notes_nbNotes(_ctx.voicesinactive);
   while(i < nbvoices){
      Notes_noteOn(_ctx.voicesinactive,i,127,0);
      i = (1 + i);
   }
   _ctx.number_voices = nbvoices;
   _ctx.voices_ratio = fix_div(0x10000 /* 1.000000 */,int_to_fix(_ctx.number_voices));
}

void Voice_setSamplerate(Voice__ctx_type_0 &_ctx, fix16_t newFs){
   if(newFs > 0x0 /* 0.000000 */){
      _ctx.fs = newFs;
   }
   if(_ctx.synth == 0){
      FM_setSamplerate(_ctx.voice0FM,_ctx.fs);
      FM_setSamplerate(_ctx.voice1FM,_ctx.fs);
      FM_setSamplerate(_ctx.voice2FM,_ctx.fs);
      FM_setSamplerate(_ctx.voice3FM,_ctx.fs);
   }
   if(_ctx.synth == 1){
      Sampler_setSamplerate(_ctx.voice0Sampler,_ctx.fs);
      Sampler_setSamplerate(_ctx.voice1Sampler,_ctx.fs);
      Sampler_setSamplerate(_ctx.voice2Sampler,_ctx.fs);
      Sampler_setSamplerate(_ctx.voice3Sampler,_ctx.fs);
   }
}

void Voice_selectSynth(Voice__ctx_type_0 &_ctx, int nsynth){
   switch(nsynth) {
      case 0:
         {
            _ctx.synth = nsynth;
            FM_default(_ctx.voice0FM);
            FM_setPoly(_ctx.voice0FM,true);
            FM_default(_ctx.voice1FM);
            FM_setPoly(_ctx.voice1FM,true);
            FM_default(_ctx.voice2FM);
            FM_setPoly(_ctx.voice2FM,true);
            FM_default(_ctx.voice3FM);
            FM_setPoly(_ctx.voice3FM,true);
         }
      break;
      case 1:
         {
            _ctx.synth = nsynth;
            Sampler_default(_ctx.voice0Sampler);
            Sampler_setPoly(_ctx.voice0Sampler,true);
            Sampler_default(_ctx.voice1Sampler);
            Sampler_setPoly(_ctx.voice1Sampler,true);
            Sampler_default(_ctx.voice2Sampler);
            Sampler_setPoly(_ctx.voice2Sampler,true);
            Sampler_default(_ctx.voice3Sampler);
            Sampler_setPoly(_ctx.voice3Sampler,true);
         }
      break;
    
   }
   Voice_setSamplerate(_ctx,_ctx.fs);
}

void Voice_copyTo(Voice__ctx_type_0 &_ctx, fix16_t (&oBuffer)[256], int nb){
   int min_size;
   min_size = 256;
   if(256 < min_size){
      min_size = 256;
   }
   nb = int_clip(nb,0,min_size);
   if(nb == 0){
      nb = min_size;
   }
   int i;
   i = 0;
   while(i < nb){
      oBuffer[i] = _ctx.buffer_o[i];
      i = (1 + i);
   }
}

